Mais uma rodada de sincericídio do presidiário que chamam de candidato:

1 - Disse que Deus deve ser, um petista;

2 - Defendeu o aborto pago pelo estado;

3 - Chamou a elite brasileira de escravistas;

4 - Defendeu limite de gastos para a classe média;

5 - Defendeu a regulamentação da internet e mídia;

6 - Falou que "família e valores são pautas atrasadas;

7 - Defendeu sindicalistas na porta da casa dos Deputados;

8 - Defendeu a volta do Financiamento a ditaduras via BNDES.

9 - "Policial não é gente";

10 - Moeda única para a América Latina;

11 - Indulto para criminosos de 17,18,19 anos;

12 - Fechar clubes de tiro do Brasil.

13 - Acabar com o teto de gastos;

14 - Fechar colégios cívico militar e resgatar o Paulo Freire de analfabetismo.

Fale mais, Lula!

